import React, { Fragment } from 'react';
import ListItem from './ListItem';
import NewList from './lists/NewList';

class List extends React.Component {
    render() {
        return (
            <Fragment>
                <div className='list'>
                    <ListItem />
                </div>
                <NewList />
            </Fragment>
        );
    }
}

export default List;
